import React, { useState, useEffect } from 'react';
import { Line } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Card } from 'react-bootstrap';


interface totalReturns{
    ReferenceDate: string
    CumulativeReturn: number
}

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

interface chart {
    labels: string[],
    datasets: {
            label: string,
            data: number[],
            borderColor: string,
            backgroundColor: string,
            fill: boolean,
        }[]
}

function ChartComponent( {ReturnsData} : {ReturnsData: totalReturns[]} ){
    const [chartData, setChartData] = useState<chart>({
        labels: [],
        datasets: [{
            label: '',
            data: [],
            borderColor: '',
            backgroundColor: '',
            fill: false,
        }],
    })

    useEffect( () => {
        const refDate = ReturnsData.map( (item) => item.ReferenceDate)
        const cumulativeRets = ReturnsData.map( (item) => item.CumulativeReturn )

        setChartData({
            labels: refDate,
            datasets: [{
                label:'Cumulative Return',
                data: cumulativeRets,
                borderColor: 'rgba(75, 192, 192, 1)',
                backgroundColor: 'rgba(75, 192, 192, 0.2)',
                fill: true,
            }],
        })
    },[ReturnsData])


  const latestReturn = chartData[chartData.length - 1]?.return || 0;
  const peakReturn = Math.max(...chartData.map(item => item?.return || 0));
  const averageReturn = chartData.length > 0
    ? (chartData.reduce((acc, curr) => acc + (curr?.return || 0), 0) / chartData.length)
    : 0;

  // Custom tooltip
  const CustomTooltip = ({ active, payload, label }) => {
    if (active && payload && payload.length) {
      return (
        <div className="bg-white p-3 shadow-lg rounded-lg border border-gray-100">
          <p className="font-medium text-gray-600">{label}</p>
          <p className="text-sm text-emerald-600">
            Return: {payload[0].value.toFixed(2)}%
          </p>
        </div>
      );
    }
    return null;
  };

  return (
    <Card className="w-full max-w-4xl p-6">
      {/* Header Section */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold text-gray-800">S&P 500 Total Returns</h2>
        <p className="text-sm text-gray-500">Historical performance tracking</p>
      </div>

      {/* Chart Section */}
      <div className="h-64 w-full">
        <ResponsiveContainer width="100%" height="100%">
          <LineChart
            data={chartData}
            margin={{ top: 5, right: 10, left: 10, bottom: 5 }}
          >
            <defs>
              <linearGradient id="returnGradient" x1="0" y1="0" x2="0" y2="1">
                <stop offset="5%" stopColor="#10b981" stopOpacity={0.1}/>
                <stop offset="95%" stopColor="#10b981" stopOpacity={0}/>
              </linearGradient>
            </defs>

            <XAxis
              dataKey="date"
              axisLine={false}
              tickLine={false}
              tick={{ fill: '#6b7280', fontSize: 12 }}
              dy={10}
            />
            <YAxis
              axisLine={false}
              tickLine={false}
              tick={{ fill: '#6b7280', fontSize: 12 }}
              dx={-10}
              tickFormatter={(value) => `${value}%`}
            />
            <Tooltip content={<CustomTooltip />} />

            <Line
              type="monotone"
              dataKey="return"
              stroke="#10b981"
              strokeWidth={2}
              dot={false}
              activeDot={{ r: 6, fill: '#10b981' }}
              fillOpacity={1}
              fill="url(#returnGradient)"
            />
          </LineChart>
        </ResponsiveContainer>
      </div>

      {/* Summary Stats */}
      <div className="grid grid-cols-3 gap-4 pt-4 mt-4 border-t">
        <div>
          <p className="text-sm text-gray-500">Latest Return</p>
          <p className="text-2xl font-semibold text-emerald-600">
            {latestReturn.toFixed(2)}%
          </p>
        </div>
        <div>
          <p className="text-sm text-gray-500">Peak Return</p>
          <p className="text-2xl font-semibold">
            {peakReturn.toFixed(2)}%
          </p>
        </div>
        <div>
          <p className="text-sm text-gray-500">Average Return</p>
          <p className="text-2xl font-semibold">
            {averageReturn.toFixed(2)}%
          </p>
        </div>
      </div>
    </Card>
  );
}

export default ChartComponent
